import "Other.css"
const OtherMore = (obj) => {

    //mapping requires key index for each entry
    return (<>
            {obj && Object.keys(obj).slice(1,undefined).map((item,i) => (
                <tbody key={i}>
                    <tr>
                        <td><b>{obj[item].question}</b></td>
                        <td>{obj[item].link}</td>
                    </tr>
                </tbody>
        ))}


    </>)

}


export default OtherMore;
